const Logos = (props={}) => {

  console.log(props)
  if (props.count <= props.list_images.length -3){
    var count1 = props.count
    var count2 = props.count +1
    var count3 = props.count +2
  }
  if (props.count === props.list_images.length -2){
      var count1 = props.count
      var count2 = props.count +1
      var count3 = 0
  }
  if (props.count === props.list_images.length -1){
    var count1 = props.count
    var count2 = 0
    var count3 = 1
}

  console.log(1)

  return (
    <div className='studied_images'>
        <img lazy="true" className='first image' src={props.list_images[count1]}></img>
        <img lazy="true" className='second image' src={props.list_images[count2]}></img>
        <img lazy="true" className='third image' src={props.list_images[count3]}></img>
    </div>
  )
}

export default Logos
